import React from "react";

const Count = () => {
  const [count, setcount] = useState(0);
  return (
    <>
      <h1>{count}</h1>
      <button
        onClick={() => {
          return count++;
        }}
      >
        Count
      </button>
    </>
  );
};

export default Count;
